      }

      }

      color: #02B6F1;
      text-decoration: none;

    }

      text-align: center;
      position: relative;
      z-index: 20;

    }

    h2 {
      position: relative;
      color: rgba(0, 0, 0, .3);
      font-size: 45px;
    }

    @media only screen and (max-width: 600px) {
      h2 {
        font-size: 24px;
      }
    }

    h2:before {
      content: attr(data-text);
      position: absolute;
      overflow: hidden;
      max-width: 15em;
      white-space: nowrap;
      color: #D24E42;
      animation: loading 5s ease-out;
    }

    @keyframes loading {
      0% {
        max-width: 0;
        color: #fff;
      }
      30%{
        color:#fff;
      }
    }


    h4 {
      font-weight: 300;
    }
